import React from "react";

interface Props { }

const chessArray = [
  [0, 1, 2, 3, 4, 5],
]

export default (props: Props) => {
  return <React.Fragment>
    <div className="container">
      {chessArray.map(c => (
        <React.Fragment>
          {c.map(i => <p>{`<>`}</p>)}
        </React.Fragment>
      ))}
    </div>
  </React.Fragment>;
};
